EisensteinE[n_Integer?EvenQ,qq_]/;n>2:=(6/((6-n) (n^2-1) BernoulliB[n])) Sum[Binomial[n,2 k+4] (2 k+3) (n-2 k-5) BernoulliB[2 k+4] BernoulliB[n-2 k-4] EisensteinE[2 k+4,qq] EisensteinE[n-2 k-4,qq],{k,0,n/2-4}]

EisensteinG[n_Integer?EvenQ,qq_]:=2 Zeta[n] EisensteinE[n,qq]

